import React from "react";
import '../css/MobileDevice.css'
import { Stack, Typography, Item, List, ListItemText, Divider, Button } from "@mui/material";

var MobileDevice = () => {
    return ( 
        <div className="mobile-device">
            <Stack spacing={1}>
                <h2 className="large-title">Large Title</h2>
                <List className="table-view">
                    <ListItemText>List Item 1</ListItemText>
                    <Divider/>
                    <ListItemText>List Item 2</ListItemText>
                    <Divider/>
                    <ListItemText>List Item 3</ListItemText>
                    <Divider/>
                </List>
                <Button className="button-type-1">Button 1</Button>
                <Button className="button-type-2">Button 2</Button>
            </Stack>
        </div>
    )
}

export default MobileDevice;
